script: |
  super -f text -I q665.sql | sort > q665.out

inputs:
  - name: q665.sql
    data: |
      SELECT - 9 AS col0 FROM tab2 AS cor0 WHERE NOT ( - 71 * - col2 * - CAST ( NULL AS REAL ) * + 89 * - col0 ) IS NOT NULL;
  - name: tab2

outputs:
  - name: q665.out
    data: |
      -9
      -9
      -9
